import { categories, products } from "../../helper/data";

function Header({clickChange}) {
  return (
    <>
      <div>
        <h1>Product List</h1>
      </div>
      <ul>
        {categories.map((kategori, index) => 
          <button onClick={()=>clickChange(kategori)} key={index}>{kategori}</button>
        )}
      </ul>
    </>
  );
}

export default Header;
